measurements.description:
One flower and one bud on one upright 35.5-cm inflorescence;
 sepals white, green basally, overlaid red-burgundy, deeper burgundy veins;
 petals green, darker green veins basally, red-burgundy apical three-forths, deep burgundy spots basal half, dense on basal superior margin;
 pouch red-burgundy, dark burgundy veins;
staminode cream, olive green veins; substance firm; texture glossy.
